import React from 'react';
import styles from './CardPlan.module.css';

export const CardPlan = ({ img, title, price }) => {
  return (
    <div className={styles.containerCard}>
      <img src={img} alt={title} />
      <b>{title}</b>
      <span>{price}</span>
    </div>
  );
};
